export {};

export class Node {
  row = 0;
  column = 0;
  value = 0;

  isStart = false;
  isVisited = false;
  isFinish = false;
  isWall = false;

  Neighbors = new Array<Node>();
  f = 0;
  g = 0;
  h = 0;

  constructor(
    row: number,
    column: number,
    isStart: boolean,
    isFinish: boolean,
    isWall: boolean
  ) {
    this.row = row;
    this.column = column;
    this.isStart = isStart;
    this.isFinish = isFinish;
    this.isWall = isWall;
  }

  createNeighbours = (grid: Node[][], x: number, y: number) => {
    const row = this.row;
    const column = this.column;
    if (column > y + 1) this.Neighbors.push(grid[row][column + 1]); // Right
    if (row > x + 1) this.Neighbors.push(grid[row + 1][column]); // Bottom
    if (column < y - 1) this.Neighbors.push(grid[row][column - 1]); // Left
    if (row < x - 1) this.Neighbors.push(grid[row - 1][column]); // Top
  };
}
